,<span style=\\\"background-color: #f1c40f;\\\"> DATA<br \\/><\\/span><\\/p>\",\"preview\":true,\"conditioned\":false,\"connected_to\":\"\",\"show_on\":\"\",\"visible\":true,\"required\":false,\"show_in_table\":false,\"label_table\":\"\",\"show_in_export\":false,\"label_export\":\"\",\"layout_alignment\":\"right\",\"id\":1667745338390},{\"type\":\"answer_text_editor\",\"label\":\"Compilabile\",\"icon\":\"<i class=\'fa fa-edit\'><\\/i>\",\"question\":\"\",\"tooltip\":\"\",\"answer\":\"<p>ATTESO che nell&rsquo;ambito delle procedure di accoglienza dei migranti sbarcati sulle coste italiane &egrave; stato trasferito in questa provincia il\\/la cittadino\\/a {{ospite_cognome}} {{ospite_nome}}, nato il {{ospite_data_nascita}} in {{ospite_luogo_nascita}}, {{ospite_vestanet}}, <span style=\\\"background-color: #f1c40f;\\\">unitamente ai componenti del nucleo famigliare che seguono XXXXXX<\\/span><\\/p>\\n<div>&nbsp;CONSIDERATO che il <span style=\\\"background-color: #f1c40f;\\\">predetto migrante\\/nucleo<\\/span> richiedente protezione internazionale &egrave; stato assegnato presso la struttura temporanea denominata {{ente_denominazione}} sita in {{ente_indirizzo}} , ai sensi dell&rsquo;art. 11 del D.Lgs 142\\/2015;<\\/div>\\n<div><br \\/><br \\/><\\/div>\",\"preview\":true,\"conditioned\":false,\"connected_to\":\"\",\"show_on\":\"\",\"visible\":true,\"required\":false,\"show_in_table\":false,\"label_table\":\"\",\"show_in_export\":false,\"label_export\":\"\",\"layout_alignment\":\"right\",\"id\":1670856084686},{\"type\":\"answer_text_editor\",\"label\":\"Compilabile\",\"icon\":\"<i class=\'fa fa-edit\'><\\/i>\",\"question\":\"\",\"tooltip\":\"\",\"answer\":\"<div>&nbsp; &nbsp; &nbsp;PRESO ATTO che il gestore della citata struttura di accoglienza con nota datata<span style=\\\"background-color: #ffdd00;\\\"> DATA NOTA<\\/span> che fa parte integrante del presente provvedimento, ha comunicato che, a seguito del rigetto al ricorso presentato a <span style=\\\"background-color: #f1c40f;\\\">TIPOLOGIA ORGANO<\\/span>,&nbsp; il suddetto richiedente ha manifestato la volont&agrave; di reiterare la richiesta di protezione internazionale, e pertanto, non ha pi&ugrave; titolo a permanere nella succitata struttura in quanto sono venute meno le condizioni che hanno determinato il diritto all&rsquo;accoglienza;<\\/div>\",\"preview\":true,\"conditioned\":false,\"connected_to\":\"\",\"show_on\":\"\",\"visible\":true,\"required\":false,\"show_in_table\":false,\"label_table\":\"\",\"show_in_export\":false,\"label_export\":\"\",\"layout_alignment\":\"right\",\"id\":1667745408614},{\"type\":\"fixed_text\",\"label\":\"Testo fisso\",\"icon\":\"<i class=\'fa fa-align-left\'><\\/i>\",\"value\":\"<div>&nbsp; &nbsp; &nbsp;RITENUTO che si siano verificate le condizioni previste dal comma 1 lettera c dell&rsquo;art. 23 del D.Lgs 142\\/2015, che prevede, tra l&rsquo;altro, la revoca delle misure di accoglienza nel caso di: &ldquo;presentazione di una domanda reiterata ai sensi dell&rsquo;art. 29 del decreto legislativo 28 gennaio 2008, n. 25, e successive modificazioni&rdquo;;<\\/div>\\n<div>&nbsp; &nbsp; &nbsp;VISTO il decreto legislativo n. 25 del 2008;<\\/div>\\n<div>&nbsp; &nbsp; &nbsp;VISTO il decreto legislativo n.142 del 2015;<\\/div>\\n<div>&nbsp; &nbsp; &nbsp;VISTA la circolare del Ministero dell&rsquo;Interno, Dipartimento per le Libert&agrave; Civili e&nbsp; l&rsquo;Immigrazione n. 2255 del 30.10.2015<\\/div>\\n<div>&nbsp;<\\/div>\\n<div>&nbsp; &nbsp; &nbsp;CONSIDERATO che il presente provvedimento costituisce atto dovuto e non discrezionale per l&rsquo;adozione del quale si omette la comunicazione prevista dagli artt. 7 e 8 della Legge 241\\/90;<\\/div>\\n<div>&nbsp;<\\/div>\\n<div style=\\\"text-align: center;\\\">DISPONE<\\/div>\",\"preview\":true,\"conditioned\":false,\"connected_to\":\"\",\"show_on\":\"\",\"visible\":true,\"show_in_table\":false,\"label_table\":\"\",\"show_in_export\":false,\"label_export\":\"\",\"layout_alignment\":\"right\",\"id\":1667745483258},{\"type\":\"answer_text_editor\",\"label\":\"Compilabile\",\"icon\":\"<i class=\'fa fa-edit\'><\\/i>\",\"question\":\"\",\"tooltip\":\"\",\"answer\":\"<p class=\\\"MsoFooter\\\" style=\\\"text-indent: 0cm;\\\"><span style=\\\"font-size: 11.0pt;\\\">Per i motivi indicati in premessa, la revoca della misura di accoglienza nei confronti di&nbsp;<\\/span>{{ospite_cognome}} {{ospite_nome}}, nato il {{ospite_data_nascita}} in {{ospite_luogo_nascita}<span style=\\\"font-size: 11.0pt;\\\">; <\\/span>{{ospite_vestanet}}, {{ospite_cui}} <span style=\\\"background-color: #f1c40f;\\\">e del nucleo famigliare<\\/span><\\/p>\\n<p class=\\\"MsoFooter\\\" style=\\\"text-indent: 0cm;\\\"><span style=\\\"font-size: 11.0pt;\\\">Il presente provvedimento di revoca ha effetto dal momento della sua comunicazione all&rsquo;interessato\\/i, ai sensi dell&rsquo;art. 23, comma 5 del D.Lgs 18.08.2015, n. 142, ovvero dall&rsquo;assolvimento delle procedure di notifica presso il luogo di domicilio ex art. 5, commi 1 e 2 del D.Lgs 142.<\\/span><\\/p>\\n<p class=\\\"MsoFooter\\\" style=\\\"text-indent: 0cm;\\\"><span style=\\\"font-size: 11.0pt;\\\">Il presente provvedimento &egrave; comunicato altres&igrave; al gestore della struttura di accoglienza, il quale, in caso di ricomparsa dell&rsquo;interessato, provveder&agrave; a consegnargliene copia.<\\/span><\\/p>\\n<p class=\\\"MsoFooter\\\" style=\\\"text-indent: 0cm;\\\"><span style=\\\"font-size: 11.0pt;\\\">Il presente provvedimento sar&agrave; trasmesso alle Prefetture e alle Questure presenti sul territorio nazionale e alla competente Commissione Territoriale per il riconoscimento della protezione internazionale.<\\/span><\\/p>\\n<p class=\\\"MsoFooter\\\" style=\\\"text-indent: 0cm;\\\"><span style=\\\"font-size: 11.0pt;\\\">Avverso il presente provvedimento &egrave; ammesso ricorso al Tribunale Amministrativo Regionale di Torino, nel termine di sessanta giorni dalla notifica all&rsquo;interessato.<\\/span><\\/p>\\n<p>&nbsp;<\\/p>\",\"preview\":true,\"conditioned\":false,\"connected_to\":\"\",\"show_on\":\"\",\"visible\":true,\"required\":false,\"show_in_table\":false,\"label_table\":\"\",\"show_in_export\":false,\"label_export\":\"\",\"layout_alignment\":\"right\",\"id\":1670856263825},{\"type\":\"answer_text_editor\",\"label\":\"Compilabile\",\"icon\":\"<i class=\'fa fa-edit\'><\\/i>\",\"question\":\"\",\"tooltip\":\"\",\"answer\":\"<div>Torino, <span style=\\\"background-color: #ffdd00;\\\">DATA PROVVEDIMENTO<\\/span>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; p. IL PREFETTO<\\/div>\\n<div>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(<span style=\\\"background-color: #ffdd00;\\\">NOME DIRIGENTE<\\/span> area IV)<\\/div>\",\"preview\":true,\"conditioned\":false,\"connected_to\":\"\",\"show_on\":\"\",\"visible\":true,\"required\":false,\"show_in_table\":false,\"label_table\":\"\",\"show_in_export\":false,\"label_export\":\"\",\"layout_alignment\":\"right\",\"id\":1667745522891},{\"type\":\"fixed_text\",\"label\":\"Testo fisso\",\"icon\":\"<i class=\'fa fa-align-left\'><\\/i>\",\"value\":\"<div><span style=\\\"font-size: 10pt;\\\">Alla Questura di Torino per la traduzione, la notifica e gli adempimenti di competenza<\\/span><\\/div>\\n<div><span style=\\\"font-size: 10pt;\\\">Alla Struttura di Accoglienza {{ente_denominazione}}<\\/span><\\/div>\\n<div><span style=\\\"font-size: 10pt;\\\">Alla Commissione Territoriale per il riconoscimento della protezione internazionale<\\/span><\\/div>\\n<div><span style=\\\"font-size: 10pt;\\\">Alle Prefetture e alle Questure della Repubblica<\\/span><\\/div>\\n<div><span style=\\\"font-size: 10pt;\\\">All\'Angrafe del Comune d<span style=\\\"background-color: #f1c40f;\\\">i XXXXX<\\/span><\\/span><\\/div>\",\"preview\":true,\"conditioned\":false,\"connected_to\":\"\",\"show_on\":\"\",\"visible\":true,\"show_in_table\":false,\"label_table\":\"\",\"show_in_export\":false,\"label_export\":\"\",\"layout_alignment\":\"right\",\"id\":1667745643446}]}', '#e2fe7f', '63b55a3e3c7c03.42521668', 1, '2022-12-12 15:46:49', '2022-12-12 15:46:49'),
(843, 4, 1, '{\"open\":false,\"primary\":true,\"layout\":\"single\",\"visibility\":{\"visibility_by_component\":false,\"components\":[]},\"title\":\"Sezione\",\"subtitle\":\"\",\"color\":\"#890e7a\",\"items\":[],\"questions\":[{\"type\":\"image\",\"label\":\"Immagine\",\"icon\":\"<i class=\'fa fa-picture-o\'><\\/i>\",\"path\":\"2022\\/11\\/6369240ff2367_prefetto.png\",\"caption\":\"\",\"preview\":true,\"conditioned\":false,\"connected_to\":\"\",\"show_on\":\"\",\"visible\":true,\"show_in_table\":false,\"label_table\":\"\",\"show_in_export\":false,\"label_export\":\"\",\"layout_alignment\":\"left\",\"id\":1666878925307},{\"type\":\"answer_text_editor\",\"label\":\"Compilabile\",\"icon\":\"<i class=\'fa fa-edit\'><\\/i>\",\"question\":\"\",\"tooltip\":\"\",\"answer\":\"<p><span style=\\\"font-family: \'times new roman\', times, serif; font-size: 18.6667px;\\\">Prot. N.&nbsp;<\\/span><span style=\\\"background-color: #f1c40f;\\\">NUM\\/anno\\/DOC<\\/span>.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Torino<span style=\\\"background-color: #f1c40f;\\\">, DATA<\\/span><\\/p>\",\"preview\":true,\"conditioned\":false,\"connected_to\":\"\",\"show_on\":\"\",\"visible\":true,\"required\":false,\"show_in_table\":false,\"label_table\":\"\",\"show_in_export\":false,\"label_export\":\"\",\"layout_alignment\":\"right\",\"id\":1667745819998},{\"type\":\"answer_text_editor\",\"label\":\"Compilabile\",\"icon\":\"<i class=\'fa fa-edit\'><\\/i>\",\"question\":\"\",\"tooltip\":\"\",\"answer\":\"<p>&nbsp;ATTESO che nell&rsquo;ambito delle procedure di accoglienza dei migranti sbarcati sulle coste italiane &egrave; stato trasferito in questa provincia il\\/la cittadino\\/a {{ospite_cognome}} {{ospite_nome}}, nato il {{ospite_data_nascita}} in {{ospite_luogo_nascita}}, {{ospite_vestanet}}, <span style=\\\"background-color: #f1c40f;\\\">unitamente ai componenti del nucleo famigliare che seguono XXXXXX<\\/span><\\/p>\\n<div>&nbsp;CONSIDERATO che il <span style=\\\"background-color: #f1c40f;\\\">predetto migrante\\/nucleo<\\/span> richiedente protezione internazionale &egrave; stato assegnato presso la struttura temporanea denominata {{ente_denominazione}} sita in {{ente_indirizzo}} , ai sensi dell&rsquo;art. 11 del D.Lgs 142\\/2015;<\\/div>\\n<p>&nbsp;<\\/p>\",\"preview\":true,\"conditioned\":false,\"connected_to\":\"\",\"show_on\":\"\",\"visible\":true,\"required\":false,\"show_in_table\":false,\"label_table\":\"\",\"show_in_export\":false,\"label_export\":\"\",\"layout_alignment\":\"right\",\"id\":1670856495733},{\"type\":\"fixed_text\",\"label\":\"Testo fisso\",\"icon\":\"<i class=\'fa fa-align-left\'><\\/i>\",\"value\":\"<div>&nbsp; &nbsp; &nbsp;CONSIDERATO che il predetto migrante richiedente protezione internazionale &egrave; stato assegnato presso la struttura temporanea denominata {{ente_denominazione}} sita in {{ente_indirizzo}}, ai sensi dell&rsquo;art. 11 del D.Lgs 142\\/2015;<\\/div>\\n<div>&nbsp; &nbsp; &nbsp;CONSIDERATE le verifiche svolte quanto alla posizione reddituale dell&rsquo;interessato;<\\/div>\\n<div>&nbsp; &nbsp; &nbsp;RITENUTO che si siano verificate le condizioni previste dal comma 1 lettera d dell&rsquo;art. 23 del D.Lgs 142\\/2015, che prevede, tra l&rsquo;altro, la revoca delle misure di accoglienza nel caso di: &ldquo;accertamento della disponibilita\' da parte del richiedente di mezzi economici sufficienti&rdquo;;<\\/div>\\n<div>&nbsp; &nbsp; &nbsp;VISTO il decreto legislativo n. 25 del 2008;<\\/div>\\n<div>&nbsp; &nbsp; &nbsp;VISTO il decreto legislativo n.142 del 2015;<\\/div>\\n<div>&nbsp; &nbsp; &nbsp;VISTA la circolare del Ministero dell&rsquo;Interno, Dipartimento per le Libert&agrave; Civili e&nbsp;&nbsp;<\\/div>\\n<div>l&rsquo;Immigrazione n. 2255 del 30.10.2015<\\/div>\\n<div>&nbsp; &nbsp; &nbsp;CONSIDERATO che il presente provvedimento costituisce atto dovuto e non discrezionale per l&rsquo;adozione del quale si omette la comunicazione prevista dagli artt. 7 e 8 della Legge 241\\/90;<\\/div>\\n<div>&nbsp;<\\/div>\\n<div style=\\\"text-align: center;\\\">DISPONE<\\/div>\\n<div>&nbsp;<\\/div>\",\"preview\":true,\"conditioned\":false,\"connected_to\":\"\",\"show_on\":\"\",\"visible\":true,\"show_in_table\":false,\"label_table\":\"\",\"show_in_export\":false,\"label_export\":\"\",\"layout_alignment\":\"right\",\"id\":1667745851661},{\"type\":\"answer_text_editor\",\"label\":\"Compilabile\",\"icon\":\"<i class=\'fa fa-edit\'><\\/i>\",\"question\":\"\",\"tooltip\":\"\",\"answer\":\"<p class=\\\"MsoFooter\\\" style=\\\"text-indent: 0cm;\\\"><span style=\\\"font-size: 11.0pt;\\\">Per i motivi indicati in premessa, la revoca della misura di accoglienza nei confronti di&nbsp;<\\/span>{{ospite_cognome}} {{ospite_nome}}, nato il {{ospite_data_nascita}} in {{ospite_luogo_nascita}<span style=\\\"font-size: 11.0pt;\\\">; <\\/span>{{ospite_vestanet}}, {{ospite_cui}} <span style=\\\"background-color: #f1c40f;\\\">e del nucleo famigliare<\\/span><\\/p>\\n<p class=\\\"MsoFooter\\\" style=\\\"text-indent: 0cm;\\\"><span style=\\\"font-size: 11.0pt;\\\">Il presente provvedimento di revoca ha effetto dal momento della sua comunicazione all&rsquo;interessato\\/i, ai sensi dell&rsquo;art. 23, comma 5 del D.Lgs 18.08.2015, n. 142, ovvero dall&rsquo;assolvimento delle procedure di notifica presso il luogo di domicilio ex art. 5, commi 1 e 2 del D.Lgs 142.<\\/span><\\/p>\\n<p class=\\\"MsoFooter\\\" style=\\\"text-indent: 0cm;\\\"><span style=\\\"font-size: 11.0pt;\\\">Il presente provvedimento &egrave; comunicato altres&igrave; al gestore della struttura di accoglienza, il quale, in caso di ricomparsa dell&rsquo;interessato, provveder&agrave; a consegnargliene copia.<\\/span><\\/p>\\n<p class=\\\"MsoFooter\\\" style=\\\"text-indent: 0cm;\\\"><span style=\\\"font-size: 11.0pt;\\\">Il presente provvedimento sar&agrave; trasmesso alle Prefetture e alle Questure presenti sul territorio nazionale e alla competente Commissione Territoriale per il riconoscimento della protezione internazionale.<\\/span><\\/p>\\n<p class=\\\"MsoFooter\\\" style=\\\"text-indent: 0cm;\\\"><span style=\\\"font-size: 11.0pt;\\\">Avverso il presente provvedimento &egrave; ammesso ricorso al Tribunale Amministrativo Regionale di Torino, nel termine di sessanta giorni dalla notifica all&rsquo;interessato.<\\/span><\\/p>\\n<p>&nbsp;<\\/p>\",\"preview\":true,\"conditioned\":false,\"connected_to\":\"\",\"show_on\":\"\",\"visible\":true,\"required\":false,\"show_in_table\":false,\"label_table\":\"\",\"show_in_export\":false,\"label_export\":\"\",\"layout_alignment\":\"right\",\"id\":1670856598848},{\"type\":\"answer_text_editor\",\"label\":\"Compilabile\",\"icon\":\"<i class=\'fa fa-edit\'><\\/i>\",\"question\":\"\",\"tooltip\":\"\",\"answer\":\"<div>&nbsp;<\\/div>\\n<div>Torino,&nbsp;<span style=\\\"background-color: #ffdd00;\\\">DATA PROVVEDIMENTO<\\/span>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; p. IL PREFETTO<\\/div>\\n<div>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(<span style=\\\"background-color: #ffdd00;\\\">NOME DIRIGENTE<\\/span>&nbsp;area IV)<\\/div>\\n<div>&nbsp;<\\/div>\",\"preview\":true,\"conditioned\":false,\"connected_to\":\"\",\"show_on\":\"\",\"visible\":true,\"required\":false,\"show_in_table\":false,\"label_table\":\"\",\"show_in_export\":false,\"label_export\":\"\",\"layout_alignment\":\"right\",\"id\":1667746031727},{\"type\":\"fixed_text\",\"label\":\"Testo fisso\",\"icon\":\"<i class=\'fa fa-align-left\'><\\/i>\",\"value\":\"<div class=\\\"MsoFooter\\\" style=\\\"text-indent: 0cm;\\\"><span style=\\\"font-size: 9.0pt;\\\">Alla Questura di Torino per la traduzione, la notifica e gli adempimenti di competenza<\\/span><\\/div>\\n<div class=\\\"MsoFooter\\\" style=\\\"text-indent: 0cm;\\\"><span style=\\\"font-size: 9.0pt;\\\">Alla Struttura di Accoglienza {{ente_denominazione}}<\\/span><\\/div>\\n<div class=\\\"MsoFooter\\\" style=\\\"text-indent: 0cm;\\\"><span style=\\\"font-size: 9.0pt;\\\">Alla Commissione Territoriale per il riconoscimento della protezione internazionale<\\/span><\\/div>\\n<div class=\\\"MsoFooter\\\" style=\\\"text-indent: 0cm;\\\"><span style=\\\"font-size: 9.0pt;\\\">Alle Prefetture e alle Questure della Repubblica<\\/span><\\/div>\\n<div class=\\\"MsoFooter\\\