(846, 11, 1, '{\"open\":false,\"primary\":true,\"layout\":\"single\",\"visibility\":{\"visibility_by_component\":false,\"components\":[]},\"title\":\"\",\"subtitle\":\"\",\"color\":\"#1d2728\",\"items\":[],\"questions\":[{\"type\":\"image\",\"label\":\"Immagine\",\"icon\":\"<i class=\'fa fa-picture-o\'><\\/i>\",\"path\":\"2022\\/11\\/636e227a653af_prefetto.png\",\"caption\":\"\",\"preview\":true,\"conditioned\":false,\"connected_to\":\"\",\"show_on\":\"\",\"visible\":true,\"show_in_table\":false,\"label_table\":\"\",\"show_in_export\":false,\"label_export\":\"\",\"layout_alignment\":\"left\",\"id\":1668162140721},{\"type\":\"answer_text_editor\",\"label\":\"Compilabile\",\"icon\":\"<i class=\'fa fa-edit\'><\\/i>\",\"question\":\"\",\"tooltip\":\"\",\"answer\":\"<div><span style=\\\"font-family: \'times new roman\', times, serif; font-size: 18.6667px;\\\">Prot. N.&nbsp;<\\/span><span style=\\\"background-color: #f1c40f;\\\">NUM\\/anno\\/DOC.&nbsp;<\\/span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Torino,<span style=\\\"background-color: #f1c40f;\\\"> DATA<br \\/><\\/span><\\/div>\\n<div>&nbsp;<\\/div>\\n<div><br \\/>\\n<div><span style=\\\"font-size: 12pt;\\\"><span style=\\\"color: #333333; font-family: Roboto, Noto Sans, -apple-system, system-ui, sans-serif;\\\"><span style=\\\"letter-spacing: 0.14px;\\\">&nbsp;PREMESSO che, <span style=\\\"background-color: #f1c40f;\\\">con note datate DATA NOTE, {{ente_denominazione}}, ha qui comunicato che il sig{{ospite_nome}}, ha contravvenuto gravemente al regolamento del Centro, poich&eacute;, in data XXXXXXX, [descrizione della violazione\\/viollazioni in ordine cronologico]<\\/span><\\/span><\\/span><span style=\\\"color: #333333; font-family: Roboto, Noto Sans, -apple-system, system-ui, sans-serif;\\\"><span style=\\\"letter-spacing: 0.14px;\\\"><span style=\\\"background-color: #f1c40f;\\\">; <br \\/><\\/span><\\/span><\\/span><\\/span><\\/div>\\n<\\/div>\\n<div>&nbsp;<\\/div>\\n<div><span style=\\\"font-size: 12pt;\\\">CONSIDERATO che in data <span style=\\\"background-color: #f1c40f;\\\">DATA<\\/span> (prot num <span style=\\\"background-color: #f1c40f;\\\">PROT<\\/span>) si &egrave; provveduto ad avviare il procedimento di revoca e che <span style=\\\"background-color: #f1c40f;\\\">XXXXXX [spiegazioni sulla risposta al procedimento di revoca e sulle giustificazioni portate ai proprio comportamenti]<\\/span><\\/span><\\/div>\\n<div>&nbsp;<\\/div>\\n<div><span style=\\\"font-size: 12pt;\\\"><span style=\\\"background-color: #f1c40f;\\\">XXXXXX<\\/span><\\/span><\\/div>\",\"preview\":true,\"conditioned\":false,\"connected_to\":\"\",\"show_on\":\"\",\"visible\":true,\"required\":false,\"show_in_table\":false,\"label_table\":\"\",\"show_in_export\":false,\"label_export\":\"\",\"layout_alignment\":\"right\",\"id\":1668162269230},{\"type\":\"answer_text_editor\",\"label\":\"Compilabile\",\"icon\":\"<i class=\'fa fa-edit\'><\\/i>\",\"question\":\"\",\"tooltip\":\"\",\"answer\":\"<p>Ritenuto che gli illeciti ascritti al sig. <span style=\\\"font-family: -apple-system, BlinkMacSystemFont, \'Segoe UI\', Roboto, Oxygen, Ubuntu, Cantarell, \'Open Sans\', \'Helvetica Neue\', sans-serif;\\\">{{ospite_cognome}} {{ospite_nome}}<\\/span><span style=\\\"font-family: -apple-system, BlinkMacSystemFont, \'Segoe UI\', Roboto, Oxygen, Ubuntu, Cantarell, \'Open Sans\', \'Helvetica Neue\', sans-serif;\\\">, siano sintomatici di una chiara tendenza alla trasgressione delle regole dell&rsquo;accoglienza del tutto incompatibile con la pacifica convivenza all&rsquo;interno della struttura;&nbsp;&nbsp;<\\/span><\\/p>\\n<div>Considerato che, alla luce delle gravi violazioni ascritte al richiedente asilo, occorre tutelare in via prioritaria l&rsquo;incolumit&agrave; degli ospiti e degli operatori della struttura di accoglienza;<\\/div>\\n<div>&nbsp;<\\/div>\\n<div>Visto il Decreto legislativo 18 agosto 2015, n. 142 emanato in &ldquo;Attuazione della direttiva 2013\\/33\\/UE recante norme relative all\'accoglienza dei richiedenti protezione internazionale\\\", nonch&eacute; della direttiva 2013\\/32\\/UE recante procedure comuni ai fini del riconoscimento e della revoca dello status di protezione internazionale;<\\/div>\\n<div>&nbsp;<\\/div>\\n<div>Ritenuto, dunque, che ricorrano nella fattispecie in argomento le previsioni di cui all&rsquo;art. 23 del succitato Decreto legislativo 18 agosto 2015, n. 142 che disciplina le ipotesi di revoca delle condizioni di accoglienza;<\\/div>\\n<div>&nbsp;<\\/div>\\n<div>Letto l&rsquo;art. 7, 1&deg; comma della Legge 7 agosto 1990 n. 241 e dato atto che l&rsquo;avvio del procedimento di revoca delle misure di accoglienza non &egrave; stato comunicato per l&rsquo;assoluta urgenza di provvedere. <!-- [if gte mso 9]><xml>\\n <o:OfficeDocumentSettings>\\n  <o:TargetScreenSize>800x600<\\/o:TargetScreenSize>\\n <\\/o:OfficeDocumentSettings>\\n<\\/xml><![endif]--><!-- [if gte mso 9]><xml>\\n <w:WordDocument>\\n  <w:View>Normal<\\/w:View>\\n  <w:Zoom>0<\\/w:Zoom>\\n  <w:TrackMoves\\/>\\n  <w:TrackFormatting\\/>\\n  <w:HyphenationZone>14<\\/w:HyphenationZone>\\n  <w:PunctuationKerning\\/>\\n  <w:ValidateAgainstSchemas\\/>\\n  <w:SaveIfXMLInvalid>false<\\/w:SaveIfXMLInvalid>\\n  <w:IgnoreMixedContent>false<\\/w:IgnoreMixedContent>\\n  <w:AlwaysShowPlaceholderText>false<\\/w:AlwaysShowPlaceholderText>\\n  <w:DoNotPromoteQF\\/>\\n  <w:LidThemeOther>IT<\\/w:LidThemeOther>\\n  <w:LidThemeAsian>X-NONE<\\/w:LidThemeAsian>\\n  <w:LidThemeComplexScript>X-NONE<\\/w:LidThemeComplexScript>\\n  <w:Compatibility>\\n   <w:BreakWrappedTables\\/>\\n   <w:SnapToGridInCell\\/>\\n   <w:WrapTextWithPunct\\/>\\n   <w:UseAsianBreakRules\\/>\\n   <w:DontGrowAutofit\\/>\\n   <w:SplitPgBreakAndParaMark\\/>\\n   <w:EnableOpenTypeKerning\\/>\\n   <w:DontFlipMirrorIndents\\/>\\n   <w:OverrideTableStyleHps\\/>\\n  <\\/w:Compatibility>\\n  <m:mathPr>\\n   <m:mathFont m:val=\\\"Cambria Math\\\"\\/>\\n   <m:brkBin m:val=\\\"before\\\"\\/>\\n   <m:brkBinSub m:val=\\\"&#45;-\\\"\\/>\\n   <m:smallFrac m:val=\\\"off\\\"\\/>\\n   <m:dispDef\\/>\\n   <m:lMargin m:val=\\\"0\\\"\\/>\\n   <m:rMargin m:val=\\\"0\\\"\\/>\\n   <m:defJc m:val=\\\"centerGroup\\\"\\/>\\n   <m:wrapIndent m:val=\\\"1440\\\"\\/>\\n   <m:intLim m:val=\\\"subSup\\\"\\/>\\n   <m:naryLim m:val=\\\"undOvr\\\"\\/>\\n  <\\/m:mathPr><\\/w:WordDocument>\\n<\\/xml><![endif]--><!-- [if gte mso 9]><xml>\\n <w:LatentStyles DefLockedState=\\\"false\\\" DefUnhideWhenUsed=\\\"false\\\"\\n  DefSemiHidden=\\\"false\\\" DefQFormat=\\\"false\\\" DefPriority=\\\"99\\\"\\n  LatentStyleCount=\\\"371\\\">\\n  <w:LsdException Locked=\\\"false\\\" Priority=\\\"0\\\" QFormat=\\\"true\\\" Name=\\\"Normal\\\"\\/>\\n  <w:LsdException Locked=\\\"fa