nbsp;<\\/span><span style=\\\"font-family: \'times new roman\', times, serif;\\\"> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<\\/span><span style=\\\"font-family: \'times new roman\', times, serif;\\\"> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<\\/span><span style=\\\"font-family: \'times new roman\', times, serif;\\\"> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<\\/span><span style=\\\"font-family: \'times new roman\', times, serif;\\\"> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<\\/span><span style=\\\"font-family: \'times new roman\', times, serif;\\\"> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<\\/span> <span style=\\\"font-family: \'times new roman\', times, serif;\\\">Torino, <\\/span><span style=\\\"background-color: #f1c40f;\\\">DATA PROT<\\/span><\\/p>\\n<p>&nbsp;<\\/p>\",\"preview\":true,\"conditioned\":false,\"connected_to\":\"\",\"show_on\":\"\",\"visible\":true,\"required\":false,\"show_in_table\":false,\"label_table\":\"\",\"show_in_export\":false,\"label_export\":\"\",\"layout_alignment\":\"right\",\"id\":1670748956712},{\"type\":\"answer_text_editor\",\"label\":\"Compilabile\",\"icon\":\"<i class=\'fa fa-edit\'><\\/i>\",\"question\":\"\",\"tooltip\":\"\",\"answer\":\"<p style=\\\"text-align: right;\\\"><span style=\\\"font-family: arial, helvetica, sans-serif;\\\">Al Sig.&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<\\/span><\\/p>\\n<div style=\\\"text-align: right;\\\"><span style=\\\"font-family: arial, helvetica, sans-serif;\\\">{{ospite_cognome}} {{ospite_nome}}, {{ospite_vestanet}}<\\/span><\\/div>\\n<div style=\\\"text-align: right;\\\"><span style=\\\"font-family: arial, helvetica, sans-serif;\\\">c\\/o <\\/span>{{sede_indirizzo}}<\\/div>\\n<div style=\\\"text-align: right;\\\">&nbsp;<\\/div>\\n<div style=\\\"text-align: right;\\\"><span style=\\\"font-family: arial, helvetica, sans-serif;\\\">Al Centro di Accoglienza&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<\\/span><\\/div>\\n<div style=\\\"text-align: right;\\\"><span style=\\\"font-family: arial, helvetica, sans-serif;\\\">{{ente_denominazione}}<\\/span><\\/div>\\n<div style=\\\"text-align: right;\\\">{{sede_indirizzo}}<\\/div>\\n<div style=\\\"text-align: right;\\\"><span style=\\\"font-family: arial, helvetica, sans-serif; background-color: #18bc9b;\\\">{{ente_email}}<\\/span><\\/div>\\n<p class=\\\"MsoNormal\\\" style=\\\"margin-left: 212.4pt; text-indent: -70.65pt; text-align: right;\\\"><span style=\\\"font-family: arial, helvetica, sans-serif;\\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; e p.c.<span style=\\\"mso-tab-count: 1;\\\"> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <\\/span>Al Dirigente del Servizio I <\\/span><\\/p>\\n<p class=\\\"MsoNormal\\\" style=\\\"margin-left: 212.4pt; text-indent: -70.65pt; text-align: right;\\\"><span style=\\\"font-family: arial, helvetica, sans-serif;\\\">della Prefettura di Torino<\\/span><\\/p>\\n<p class=\\\"MsoNormal\\\" style=\\\"margin-left: 212.4pt; text-indent: -70.65pt; text-align: right;\\\">Al servizio convivenze dell\'anagrafe del Comune di <span style=\\\"background-color: #f1c40f;\\\">XXXX<\\/span><\\/p>\\n<p class=\\\"MsoNormal\\\" style=\\\"margin-left: 212.4pt; text-indent: -70.65pt; text-align: left;\\\">OGGETTO: Sig. {{ospite_cognome}} {{ospite_nome}}, nato il {{ospite_data_nascita}} in {{ospite_luogo_nascita}}, {{ospite_vestanet}}, {{ospite_cui}}<\\/p>\\n<div>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <strong>&nbsp; &nbsp; Cessazione delle misure di accoglienza<\\/strong><\\/div>\\n<div>&nbsp;<\\/div>\\n<div>\\n<p class=\\\"MsoNormal\\\" style=\\\"text-indent: 35.4pt;\\\"><span style=\\\"font-family: arial, helvetica, sans-serif;\\\"><span style=\\\"font-size: 12pt;\\\">Atteso che la S.V. ha <a style=\\\"mso-comment-reference: \'BMS\\\\(_1\'; mso-comment-date: 20211223T0852;\\\">avuto lo status di rifugiato con decreto dalla Commissione Territoriale per la Protezione Internazionale di Torino <span style=\\\"background-color: #f1c40f;\\\">(DATA)<\\/span>, essendo stata rifiutata la sua candidatura dal sistema SAI per mancanza dei necessari requisiti di integrazione, sono venuti meno i requisiti per il mantenimento delle misure di accoglienza a Suo favore.<\\/a><\\/span><\\/span><\\/p>\\n<p class=\\\"MsoNormal\\\" style=\\\"text-indent: 35.4pt;\\\"><span style=\\\"font-family: arial, helvetica, sans-serif; background-color: #f1c40f;\\\"><span style=\\\"font-size: 12pt; background-color: #f1c40f;\\\">OPPURE<\\/span><\\/span><\\/p>\\n<p class=\\\"MsoNormal\\\" style=\\\"text-indent: 35.4pt;\\\">&nbsp; <span style=\\\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\\\"> Si informa la S.V. che, avendo rinunciato all&rsquo;inserimento in un progetto SAI gestito dal Comune <span style=\\\"background: #f1c40f;\\\">COMUNE DI DESTINAZIONE PROPOSTO<\\/span>, pur avendone i requisiti, sono venute meno le condizioni per permanere nella struttura di accoglienza per scadenza dei tempi di permanenza <\\/span><\\/p>\\n<p class=\\\"MsoNormal\\\" style=\\\"text-indent: 35.4pt;\\\"><span style=\\\"font-family: arial, helvetica, sans-serif; background-color: #f1c40f;\\\"><span style=\\\"font-size: 12pt; background-color: #f1c40f;\\\">OPPURE<\\/span><\\/span><\\/p>\\n<p class=\\\"MsoNormal\\\" style=\\\"text-indent: 35.4pt;\\\"><span style=\\\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\\\">Atteso che la S.V. <span style=\\\"background-color: #f1c40f;\\\">ha ricevuto l&rsquo;esito negativo da parte dell\'autorit&agrave; giudiziaria avvero il provvedimento della Commissione\\/Tribunale\\/<\\/span><\\/span><span style=\\\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\\\"><span style=\\\"background-color: #f1c40f;\\\"> di <\\/span><span style=\\\"background: yellow; mso-highlight: yellow;\\\">i<span style=\\\"background-color: #f1c40f;\\\">nammissibilit&agrave; del ricorso presentato alla Corte di Cassazione avverso il rigetto del Tribunale di Torino\\/ il rigetto del ricorso da parte della Tribunale di Torino<\\/span><\\/span><span style=\\\"background-color: #f1c40f;\\\">, senza che sia stata presentato ricorso in Corte di Cassazione<\\/span>, si comunica che sono venuti meno i requisiti per il mantenimento delle misure di accoglienza a Suo favore<\\/span><\\/p>\\n<p class=\\\"MsoNormal\\\" style=\\\"text-indent: 35.4pt;\\\"><!-- [if gte mso 9]><xml>\\n <o:OfficeDocumentSettings>\\n  <o:AllowPNG\\/>\\n <\\/o:OfficeDocumentSettings>\\n<\\/xml><![endif]--><!-- [if gte mso 9]><xml>\\n <w:WordDocument>\\n  <w:View>Normal<\\/w:View>\\n  <w:Zoom>0<\\/w:Zoom>\\n  <w:TrackMoves\\/>\\n  <w:TrackFormatting\\/>\\n  <w:HyphenationZone>14<\\/w:HyphenationZone>\\n  <w:PunctuationKerning\\/>\\n  <w:ValidateAgainstSchemas\\/>\\n  <w:SaveIfXMLInvalid>false<\\/w:SaveIfXMLInvalid>\\n  <w:IgnoreMixedContent>false<\\/w:IgnoreMixedContent>\\n  <w:AlwaysShowPlaceholderText>false<\\/w:AlwaysShowPlaceholderText>\\n  <w:DoNotPromoteQF\\/>\\n  <w:LidThemeOther>