ority=\\\"51\\\"\\n   Name=\\\"List Table 6 Colorful Accent 5\\\"\\/>\\n  <w:LsdException Locked=\\\"false\\\" Priority=\\\"52\\\"\\n   Name=\\\"List Table 7 Colorful Accent 5\\\"\\/>\\n  <w:LsdException Locked=\\\"false\\\" Priority=\\\"46\\\"\\n   Name=\\\"List Table 1 Light Accent 6\\\"\\/>\\n  <w:LsdException Locked=\\\"false\\\" Priority=\\\"47\\\" Name=\\\"List Table 2 Accent 6\\\"\\/>\\n  <w:LsdException Locked=\\\"false\\\" Priority=\\\"48\\\" Name=\\\"List Table 3 Accent 6\\\"\\/>\\n  <w:LsdException Locked=\\\"false\\\" Priority=\\\"49\\\" Name=\\\"List Table 4 Accent 6\\\"\\/>\\n  <w:LsdException Locked=\\\"false\\\" Priority=\\\"50\\\" Name=\\\"List Table 5 Dark Accent 6\\\"\\/>\\n  <w:LsdException Locked=\\\"false\\\" Priority=\\\"51\\\"\\n   Name=\\\"List Table 6 Colorful Accent 6\\\"\\/>\\n  <w:LsdException Locked=\\\"false\\\" Priority=\\\"52\\\"\\n   Name=\\\"List Table 7 Colorful Accent 6\\\"\\/>\\n <\\/w:LatentStyles>\\n<\\/xml><![endif]--><!-- [if gte mso 10]>\\n<style>\\n \\/* Style Definitions *\\/\\n table.MsoNormalTable\\n\\t{mso-style-name:\\\"Tabella normale\\\";\\n\\tmso-tstyle-rowband-size:0;\\n\\tmso-tstyle-colband-size:0;\\n\\tmso-style-noshow:yes;\\n\\tmso-style-priority:99;\\n\\tmso-style-parent:\\\"\\\";\\n\\tmso-padding-alt:0cm 5.4pt 0cm 5.4pt;\\n\\tmso-para-margin:0cm;\\n\\tmso-para-margin-bottom:.0001pt;\\n\\tmso-pagination:widow-orphan;\\n\\tfont-size:10.0pt;\\n\\tfont-family:\\\"Calibri\\\",sans-serif;\\n\\tmso-bidi-font-family:\\\"Times New Roman\\\";}\\n<\\/style>\\n<![endif]--><span style=\\\"font-size: 12.0pt; font-family: \'Times New Roman\',serif; mso-fareast-font-family: Calibri; mso-ansi-language: IT; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\\\">Atteso che la S.V. ha ricevuto l&rsquo;esito negativo del ricorso presentato all&rsquo;Autorit&agrave; giudiziaria avverso il diniego della Commissione Territoriale per la Protezione Internazionale di Torino<\\/span><\\/p>\\n<p class=\\\"MsoNormal\\\" style=\\\"text-indent: 35.4pt;\\\"><span style=\\\"font-family: arial, helvetica, sans-serif; background-color: #f1c40f;\\\"><span style=\\\"font-size: 12pt; background-color: #f1c40f;\\\">OPPURE<\\/span><\\/span><\\/p>\\n<p class=\\\"MsoNormal\\\" style=\\\"text-indent: 35.4pt;\\\"><span style=\\\"font-family: \'Times New Roman\',serif;\\\">Si informa la S.V. che, avendo ricevuto il rigetto <span style=\\\"background-color: #f1c40f;\\\">per manifesta infondatezza dalla commissione territoriale per la protezione internazionale in data 3\\/12\\/21, in assenza di esplicita sospensiva dell\'efficacia esecutiva del provvedimento impugnato da parte del Tribunale di Torino quanto al ricorso RG<\\/span><\\/span> <span style=\\\"font-family: \'Times New Roman\',serif;\\\"><span style=\\\"background-color: #f1c40f;\\\">24845\\/2021 del 27\\/5\\/22<\\/span>, e in considerazione dell&rsquo;art 14 comma 4 del decreto legislativo 142\\/2015, <\\/span><\\/p>\\n<p class=\\\"MsoNormal\\\" style=\\\"text-indent: 35.4pt;\\\"><span style=\\\"font-size: 12.0pt; font-family: \'Times New Roman\',serif; mso-fareast-font-family: Calibri; mso-ansi-language: IT; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\\\">&ldquo;<\\/span><em style=\\\"mso-bidi-font-style: normal;\\\"><span style=\\\"font-size: 10.0pt; font-family: \'Times New Roman\',serif; mso-fareast-font-family: Calibri; mso-ansi-language: IT; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\\\">Le misure di accoglienza sono assicurate per la durata del procedimento di esame della domanda da parte della Commissione territoriale per il riconoscimento della protezione internazionale di cui all\'articolo 4 del decreto legislativo 28 gennaio 2008, n. 25, e successive modificazioni, e, in caso di rigetto, fino alla scadenza del termine per l\'impugnazione della decisione. Salvo quanto previsto dall\'articolo 6, comma 7, in caso di ricorso giurisdizionale proposto ai sensi dell\'articolo 35 del decreto legislativo 28 gennaio 2008, n. 25, e successive modificazioni, il ricorrente, privo di mezzi sufficienti ((...)), usufruisce delle misure di accoglienza di cui al presente decreto per il tempo in cui e\' autorizzato a rimanere nel territorio nazionale ai sensi dell\'articolo 35-bis, commi 3 e 4, del decreto legislativo 28 gennaio 2008, n. 25. Nei casi di cui all\'articolo 35-bis, comma 4, del decreto legislativo 28 gennaio 2008, n. 25, fino alla decisione sull\'istanza di sospensione ricorrente rimane nella struttura o nel centro in cui si trova&rdquo;<\\/span><\\/em><\\/p>\\n<p class=\\\"MsoNormal\\\" style=\\\"text-indent: 35.4pt;\\\"><span style=\\\"font-family: arial, helvetica, sans-serif; background-color: #f1c40f;\\\"><span style=\\\"font-size: 12pt; background-color: #f1c40f;\\\">OPPURE<\\/span><\\/span><\\/p>\\n<p class=\\\"MsoNormal\\\" style=\\\"text-indent: 35.4pt;\\\"><span style=\\\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\\\"> Si informa che la S.V., avendo dichiarato con nota del <span style=\\\"background: yellow; mso-highlight: yellow;\\\">DATA NOTA<\\/span> di rifiutare il trasferimento presso la cooperativa <span style=\\\"background-color: #f1c40f;\\\">NOME\\/<\\/span>di voler abbandonare definitivamente il progetto di accoglienza presso il Cas gestito dalla Coop. <span style=\\\"background-color: #f1c40f;\\\">NOME,<\\/span> sono venute meno le condizioni che hanno determinato il diritto all&rsquo;accoglienza.<\\/span><\\/p>\\n<p class=\\\"MsoNormal\\\" style=\\\"text-indent: 35.4pt;\\\"><span style=\\\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\\\">Pertanto, la S.V. &egrave; tenuta a lasciare la struttura di accoglienza entro e non oltre 24 ore dalla notifica della presente comunicazione.<\\/span><\\/p>\\n<p class=\\\"MsoNormal\\\" style=\\\"text-indent: 35.4pt;\\\"><span style=\\\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\\\">&nbsp;<\\/span><\\/p>\\n<p class=\\\"MsoNormal\\\" style=\\\"text-indent: 35.4pt;\\\"><span style=\\\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\\\">Il Responsabile del Centro di Accoglienza &egrave; pregato di comunicare a questa Prefettura l&rsquo;avvenuta uscita dalla struttura<\\/span><\\/p>\\n<div style=\\\"mso-element: comment-list;\\\">\\n<div style=\\\"mso-element: comment;\\\">\\n<div id=\\\"_com_1\\\" class=\\\"msocomtxt\\\"><span style=\\\"mso-comment-author: \'Belleni Morante S\\\\. \\\\(dpp1061247\\\\)\';\\\"><a name=\\\"_msocom_1\\\"><\\/a><\\/span><\\/div>\\n<\\/div>\\n<\\/div>\\n<\\/div>\\n<p>&nbsp;<\\/p>\\n<p>&nbsp;<\\/p>\",\"preview\":true,\"conditioned\":false,\"connected_to\":\"\",\"show_on\":\"\",\"visible\":true,\"required\":false,\"show_in_table\":false,\"label_table\":\"\",\"show_in_export\":false,\"label_export\":\"\",\"layout_alignment\":\"right\",\"id\":1670749021235},{\"type\":\"answer_text_editor\",\"label\":\"Compilabile\",\"icon\":\"<i class=\'fa fa-edit\'><\\/i>\",\"question\":\"\",\"tooltip\":\"\",\"answer\":\"<div class=\\\"MsoNormal\\\" style=\\\"text-align: right;\\\"><span style=\\\"font-size: 12.0pt; font-family: \'Times New Roman\',serif;\\\">Il Dirigente dell&rsquo;Area IV<\\/span><\\/div>\\n<div class=\\\"MsoNormal\\\" style=\\\"text-align: right; padding-left: 280px;\\\"><span style=\\\"font-family: \'Times New Roman\',serif;\\\">&nbsp;(<span style=\\\"background: yellow; mso-highlight: yellow;\\\">NOME DIRIGENTE area IV<\\/span>)<\\/span><\\/div>\\n<p class=\\\"MsoNormal\\\" style=\\\"text-align: justify;\\\"><span style=\\\"font-family: \'Times New Roman\',serif; background: yellow; mso-highlight: yellow;\\\">Sigla della persona che ha fatto la nota<\\/span><\\/p>\\n<p>&nbsp;<\\/p>\",\"preview\":true,\"conditioned\":false,\"connected_to\":\"\",\"show_on\":\"\",\"visible\":true,\"required\":false,\"show_in_table\":false,\"label_table\":\"\",\"show_in_export\":false,\"label_export\":\"\",\"layout_alignment\":\"right\",\"id\":1670749415301}]}', '#4d0679', '63b564d1853773.25083169', 1, '2022-12-12 16:17:14', '2022-12-12 16:17:14');
