e>\\n \\/* Style Definitions *\\/\\n table.MsoNormalTable\\n\\t{mso-style-name:\\\"Tabella normale\\\";\\n\\tmso-tstyle-rowband-size:0;\\n\\tmso-tstyle-colband-size:0;\\n\\tmso-style-noshow:yes;\\n\\tmso-style-priority:99;\\n\\tmso-style-parent:\\\"\\\";\\n\\tmso-padding-alt:0cm 5.4pt 0cm 5.4pt;\\n\\tmso-para-margin-top:0cm;\\n\\tmso-para-margin-right:0cm;\\n\\tmso-para-margin-bottom:10.0pt;\\n\\tmso-para-margin-left:0cm;\\n\\tline-height:115%;\\n\\tmso-pagination:widow-orphan;\\n\\tfont-size:11.0pt;\\n\\tfont-family:\\\"Calibri\\\",sans-serif;\\n\\tmso-ascii-font-family:Calibri;\\n\\tmso-ascii-theme-font:minor-latin;\\n\\tmso-hansi-font-family:Calibri;\\n\\tmso-hansi-theme-font:minor-latin;\\n\\tmso-bidi-font-family:Arial;\\n\\tmso-bidi-theme-font:minor-bidi;}\\n<\\/style>\\n<![endif]--><\\/p>\\n<p class=\\\"MsoFooter\\\" style=\\\"text-indent: 0cm;\\\"><span style=\\\"font-size: 11.0pt;\\\">Per i motivi indicati in premessa, la revoca della misura di accoglienza nei confronti di&nbsp;<\\/span>{{ospite_cognome}} {{ospite_nome}}, nato il {{ospite_data_nascita}} in {{ospite_luogo_nascita}<span style=\\\"font-size: 11.0pt;\\\">; <\\/span>{{ospite_vestanet}}, {{ospite_cui}} <span style=\\\"background-color: #f1c40f;\\\">e del nucleo famigliare<\\/span><\\/p>\\n<p class=\\\"MsoFooter\\\" style=\\\"text-indent: 0cm;\\\"><span style=\\\"font-size: 11.0pt;\\\">Il presente provvedimento di revoca ha effetto dal momento della sua comunicazione all&rsquo;interessato\\/i, ai sensi dell&rsquo;art. 23, comma 5 del D.Lgs 18.08.2015, n. 142, ovvero dall&rsquo;assolvimento delle procedure di notifica presso il luogo di domicilio ex art. 5, commi 1 e 2 del D.Lgs 142.<\\/span><\\/p>\\n<p class=\\\"MsoFooter\\\" style=\\\"text-indent: 0cm;\\\"><span style=\\\"font-size: 11.0pt;\\\">Il presente provvedimento &egrave; comunicato altres&igrave; al gestore della struttura di accoglienza, il quale, in caso di ricomparsa dell&rsquo;interessato, provveder&agrave; a consegnargliene copia.<\\/span><\\/p>\\n<p class=\\\"MsoFooter\\\" style=\\\"text-indent: 0cm;\\\"><span style=\\\"font-size: 11.0pt;\\\">Il presente provvedimento sar&agrave; trasmesso alle Prefetture e alle Questure presenti sul territorio nazionale e alla competente Commissione Territoriale per il riconoscimento della protezione internazionale.<\\/span><\\/p>\\n<p class=\\\"MsoFooter\\\" style=\\\"text-indent: 0cm;\\\"><span style=\\\"font-size: 11.0pt;\\\">Avverso il presente provvedimento &egrave; ammesso ricorso al Tribunale Amministrativo Regionale di Torino, nel termine di sessanta giorni dalla notifica all&rsquo;interessato.<\\/span><\\/p>\\n<p class=\\\"MsoFooter\\\" style=\\\"text-indent: 0cm;\\\"><span style=\\\"font-size: 11.0pt;\\\">Torino, <span style=\\\"background: yellow; mso-highlight: yellow;\\\">DATA PROVVEDIMENTO<\\/span><\\/span><\\/p>\",\"preview\":true,\"conditioned\":false,\"connected_to\":\"\",\"show_on\":\"\",\"visible\":true,\"required\":false,\"show_in_table\":false,\"label_table\":\"\",\"show_in_export\":false,\"label_export\":\"\",\"layout_alignment\":\"right\",\"id\":1670855574807},{\"type\":\"answer_text_editor\",\"label\":\"Compilabile\",\"icon\":\"<i class=\'fa fa-edit\'><\\/i>\",\"question\":\"\",\"tooltip\":\"\",\"answer\":\"<p><!-- [if gte mso 9]><xml>\\n <w:WordDocument>\\n  <w:View>Normal<\\/w:View>\\n  <w:Zoom>0<\\/w:Zoom>\\n  <w:TrackMoves\\/>\\n  <w:TrackFormatting\\/>\\n  <w:HyphenationZone>14<\\/w:HyphenationZone>\\n  <w:PunctuationKerning\\/>\\n  <w:ValidateAgainstSchemas\\/>\\n  <w:SaveIfXMLInvalid>false<\\/w:SaveIfXMLInvalid>\\n  <w:IgnoreMixedContent>false<\\/w:IgnoreMixedContent>\\n  <w:AlwaysShowPlaceholderText>false<\\/w:AlwaysShowPlaceholderText>\\n  <w:DoNotPromoteQF\\/>\\n  <w:LidThemeOther>IT<\\/w:LidThemeOther>\\n  <w:LidThemeAsian>X-NONE<\\/w:LidThemeAsian>\\n  <w:LidThemeComplexScript>AR-SA<\\/w:LidThemeComplexScript>\\n  <w:Compatibility>\\n   <w:BreakWrappedTables\\/>\\n   <w:SnapToGridInCell\\/>\\n   <w:WrapTextWithPunct\\/>\\n  