\\\"List Table 4 Accent 3\\\"\\/>\\n  <w:LsdException Locked=\\\"false\\\" Priority=\\\"50\\\" Name=\\\"List Table 5 Dark Accent 3\\\"\\/>\\n  <w:LsdException Locked=\\\"false\\\" Priority=\\\"51\\\"\\n   Name=\\\"List Table 6 Colorful Accent 3\\\"\\/>\\n  <w:LsdException Locked=\\\"false\\\" Priority=\\\"52\\\"\\n   Name=\\\"List Table 7 Colorful Accent 3\\\"\\/>\\n  <w:LsdException Locked=\\\"false\\\" Priority=\\\"46\\\"\\n   Name=\\\"List Table 1 Light Accent 4\\\"\\/>\\n  <w:LsdException Locked=\\\"false\\\" Priority=\\\"47\\\" Name=\\\"List Table 2 Accent 4\\\"\\/>\\n  <w:LsdException Locked=\\\"false\\\" Priority=\\\"48\\\" Name=\\\"List Table 3 Accent 4\\\"\\/>\\n  <w:LsdException Locked=\\\"false\\\" Priority=\\\"49\\\" Name=\\\"List Table 4 Accent 4\\\"\\/>\\n  <w:LsdException Locked=\\\"false\\\" Priority=\\\"50\\\" Name=\\\"List Table 5 Dark Accent 4\\\"\\/>\\n  <w:LsdException Locked=\\\"false\\\" Priority=\\\"51\\\"\\n   Name=\\\"List Table 6 Colorful Accent 4\\\"\\/>\\n  <w:LsdException Locked=\\\"false\\\" Priority=\\\"52\\\"\\n   Name=\\\"List Table 7 Colorful Accent 4\\\"\\/>\\n  <w:LsdException Locked=\\\"false\\\" Priority=\\\"46\\\"\\n   Name=\\\"List Table 1 Light Accent 5\\\"\\/>\\n  <w:LsdException Locked=\\\"false\\\" Priority=\\\"47\\\" Name=\\\"List Table 2 Accent 5\\\"\\/>\\n  <w:LsdException Locked=\\\"false\\\" Priority=\\\"48\\\" Name=\\\"List Table 3 Accent 5\\\"\\/>\\n  <w:LsdException Locked=\\\"false\\\" Priority=\\\"49\\\" Name=\\\"List Table 4 Accent 5\\\"\\/>\\n  <w:LsdException Locked=\\\"false\\\" Priority=\\\"50\\\" Name=\\\"List Table 5 Dark Accent 5\\\"\\/>\\n  <w:LsdException Locked=\\\"false\\\" Priority=\\\"51\\\"\\n   Name=\\\"List Table 6 Colorful Accent 5\\\"\\/>\\n  <w:LsdException Locked=\\\"false\\\" Priority=\\\"52\\\"\\n   Name=\\\"List Table 7 Colorful Accent 5\\\"\\/>\\n  <w:LsdException Locked=\\\"false\\\" Priority=\\\"46\\\"\\n   Name=\\\"List Table 1 Light Accent 6\\\"\\/>\\n  <w:LsdException Locked=\\\"false\\\" Priority=\\\"47\\\" Name=\\\"List Table 2 Accent 6\\\"\\/>\\n  <w:LsdException Locked=\\\"false\\\" Priority=\\\"48\\\" Name=\\\"List Table 3 Accent 6\\\"\\/>\\n  <w:LsdException Locked=\\\"false\\\" Priority=\\\"49\\\" Name=\\\"List Table 4 Accent 6\\\"\\/>\\n  <w:LsdException Locked=\\\"false\\\" Priority=\\\"50\\\" Name=\\\"List Table 5 Dark Accent 6\\\"\\/>\\n  <w:LsdException Locked=\\\"false\\\" Priority=\\\"51\\\"\\n   Name=\\\"List Table 6 Colorful Accent 6\\\"\\/>\\n  <w:LsdException Locked=\\\"false\\\" Priority=\\\"52\\\"\\n   Name=\\\"List Table 7 Colorful Accent 6\\\"\\/>\\n <\\/w:LatentStyles>\\n<\\/xml><![endif]--><!-- [if gte mso 10]>\\n<style>\\n \\/* Style Definitions *\\/\\n table.MsoNormalTable\\n\\t{mso-style-name:\\\"Tabella normale\\\";\\n\\tmso-tstyle-rowband-size:0;\\n\\tmso-tstyle-colband-size:0;\\n\\tmso-style-noshow:yes;\\n\\tmso-style-priority:99;\\n\\tmso-style-parent:\\\"\\\";\\n\\tmso-padding-alt:0cm 5.4pt 0cm 5.4pt;\\n\\tmso-para-margin:0cm;\\n\\tmso-para-margin-bottom:.0001pt;\\n\\tmso-pagination:widow-orphan;\\n\\tfont-size:10.0pt;\\n\\tfont-family:\\\"Calibri\\\",sans-serif;\\n\\tmso-bidi-font-family:\\\"Times New Roman\\\";}\\n<\\/style>\\n<![endif]--><\\/p>\\n<p>&nbsp;&nbsp;&nbsp;&nbsp; {{ente_denominazione}}, in qualit&agrave; di Ente gestore del Centro di accoglienza straordinaria per richiedenti asilo ubicato in {{struttura_indirizzo}}, con note del XXX, del XXXX e XXXX ha qui comunicato, per l&rsquo;eventuale adozione del provvedimento di revoca delle misure di accoglienza, che la S.V. ha contravvenuto al regolamento del Centro, in quanto si &egrave; reso protagonista di [da compilare secondo la problematica ].<\\/p>\\n<p><strong>&nbsp;&nbsp;&nbsp;&nbsp; <\\/strong>In relazione a tanto, la S.V. &egrave; diffidata ad attenersi in modo scrupoloso e tassativo al regolamento del Centro di accoglienza e alle disposizioni applicative legittimamente impartite dagli operatori della struttura ospitante.<\\/p>\\n<p><strong>&nbsp;&nbsp;&nbsp;&nbsp; <\\/strong>[da utilizzarsi unicamente in caso di trasferimento]Considerato che la Corte di Giustizia Europea, con sentenza C 233-2018, ha stabilito che &ldquo;uno Stato membro non pu&ograve; prevedere, tra le sanzioni che possono essere inflitte ad un richiedente in caso di gravi violazioni delle regole dei centri di accoglienza nonch&eacute; di comportamenti gravemente violenti, una sanzione consistente nel revocare, seppur temporaneamente, le condizioni materiali di accoglienza&rdquo; &nbsp;e che, in caso di comportamenti violenti, si possano valutare sanzioni quali &ldquo;il suo trasferimento in un altro centro di accoglienza&rdquo;, a seguito degli avvenimenti descritti nella nota del XXXX, si dispone il trasferimento presso la Cooperativa XXXX, nel rispetto della normativa COVID. Il rifiuto del trasferimento verr&agrave; equiparato alla rinuncia all&rsquo;accoglienza ai sensi dell&rsquo;art. 15 del Decreto legislativo 18 agosto 2015, n. 142.<\\/p>\\n<p><strong>&nbsp;&nbsp;&nbsp;&nbsp; <\\/strong>Tanto si comunica a mente degli artt. 7 e 8 della Legge 241 del 7 agosto 1990 e si invita la S.V. a far pervenire, a mente dell&rsquo;art. 10 della Legge citata, nel termine di 10 giorni dal ricevimento della presente, le proprie osservazioni scritte in proposito, eventualmente corredate da documenti, con avvertenza che per i fatti suesposti potrebbe essere adottato il provvedimento di revoca delle misure di accoglienza a norma dell&rsquo;art. 23 del Decreto legislativo 18 agosto 2015, n. 142, che disciplina le ipotesi di revoca delle condizioni di accoglienza.<\\/p>\\n<p><strong>&nbsp;&nbsp;&nbsp;&nbsp; <\\/strong>Inoltre si precisa quanto segue:<\\/p>\\n<p>&nbsp;&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Competente ad adottare il provvedimento finale &egrave; il Prefetto ai sensi dell&rsquo;art. 23 del Decreto legislativo n. 142 del 2015;<\\/p>\\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; L&rsquo;Ufficio e la persona responsabile del procedimento sono, rispettivamente, l&rsquo;Area IV- Diritti Civili, Cittadinanza, Condizione Giuridica dello Straniero, Immigrazione e Diritto D\'Asilo e il Dirigente dell&rsquo;Area&nbsp; dr. Gianfranco Parente;<\\/p>\\n<p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Eventuali istanze di accesso agli atti potranno essere inoltrate&nbsp; agli indirizzi <a href=\\\"mailto:prefettura.prefto@pec.interno.it\\\">prefettura.prefto@pec.interno.it<\\/a> e\\/o <a href=\\\"mailto:cas.pref_torino@interno.it\\\">cas.pref_torino@interno.it<\\/a>.<\\/p>\\n<p><strong>&nbsp;&nbsp;&nbsp;&nbsp; <\\/strong>L&rsquo;Ente gestore in indirizzo &egrave; pregato di voler notificare la presente comunicazione al\'ospite in oggetto nominato, restituendone a questo Ufficio copia munita della relata di notifica all&rsquo;interessato.<\\/p>\",\"preview\":true,\"conditioned\":false,\"connected_to\":\"\",\"show_on\":\"\",\"visible\":true,\"required\":false,\"show_in_table\":false,\"label_table\":\"\",\"show_in_export\":false,\"label_export\":\"\",\"layout_alignment\":\"right\",\"id\":1670748784827},{\"type\":\"answer_text_editor\",\"label\":\"Compilabile\",\"icon\":\"<i class=\'fa fa-edit\'><\\/i>\",\"question\":\"\",\"tooltip\":\"\",\"answer\":\"<p>&nbsp;<\\/p>\\n<table style=\\\"border-collapse: collapse; width: 100%; border-style: none; word-wrap: break-word;\\\" border=\\\"0\\\" cellpadding=\\\"4\\\">\\n<tbody>\\n<tr>\\n<td style=\\\"width: 55%;\\\">&nbsp;<\\/td>\\n<td style=\\\"width: 45%; text-align: center;\\\">IL DIRIGENTE DELL&rsquo;AREA IV<\\/td>\\n<\\/tr>\\n<tr>\\n<td style=\\\"width: 55%; text-align: center;\\\"><span style=\\\"background-color: #f1c40f;\\\">Sigla della persona che ha fatto la nota<\\/span><\\/td>\\n<td style=\\\"width: 45%; text-align: center;\\\">(<span style=\\\"background-color: #f1c40f;\\\">NOME DIRIGENTE area IV<\\/span>)<\\/td>\\n<\\/tr>\\n<\\/tbody>\\n<\\/table>\",\"preview\":true,\"conditioned\":false,\"connected_to\":\"\",\"show_on\":\"\",\"visible\":true,\"required\":false,\"show_in_table\":false,\"label_table\":\"\",\"show_in_export\":false,\"label_export\":\"\",\"layout_alignment\":\"right\",\"id\":1670748794882}]}', '#bbb085', '63b565bd94d907.71143176', 1, '2023-01-04 11:52:01', '2023-01-04 11:52:01');
INSERT INTO `surveys_chapters` (`id`, `id_survey`, `chapter`, `chapter_data`, `color`, `group_id`, `deleted`, `created`, `modified`) VALUES
(949, 4, 1, '{\"open\":true,\"primary\":true,\"layout\":\"single\",\"visibility\":{\"visibility_by_component\":false,\"components\":[]},\"title\":\"Sezione\",\"subtitle\":\"\",\"color\":\"#890e7a\",\"items\":[],\"questions\":[{\"type\":\"image\",\"label\":\"Immagine\",\"icon\":\"<i class=\'fa fa-picture-o\'><\\/i>\",\"path\":\"2022\\/11\\/6369240ff2367_prefetto.png\",\"caption\":\"\",\"preview\":true,\"conditioned\":false,\"connected_to\":\"\",\"show_on\":\"\",\"visible\":true,\"show_in_table\":false,\"label_table\":\"\",\"show_in_export\":false,\"label_export\":\"\",\"layout_alignment\":\"left\",\"id\":1666878925307},{\"type\":\"answer_text_editor\",\"label\":\"Compilabile\",\"icon\":\"<i class=\'fa fa-edit\'><\\/i>\",\"question\":\"\",\"tooltip\":\"\",\"answer\":\"<p>&nbsp;<\\/p>\\n<table style=\\\"border-collapse: collapse; width: 100%; border-style: none;\\\" border=\\\"0\\\" cellpadding=\\\"4\\\">\\n<tbody>\\n<tr>\\n<td style=\\\"width: 50%;\\\">Prot. N <span style=\\\"background-color: #f1c40f;\\\">XXXX<\\/span>\\/<span style=\\\"background-color: #f1c40f;\\\">XXX<\\/span>\\/Area IV<\\/td>\\n<td style=\\\"width: 50%; text-align: right;\\\">Torino, <span style=\\\"background-color: #f1c40f;\\\">DATA PROT<\\/span><\\/td>\\n<\\/tr>\\n<\\/tbody>\\n<\\/table>\\n<p>&nbsp;<\\/p>\",\"preview\":true,\"conditioned\":false,\"connected_to\":\"\",\"show_on\":\"\",\"visible\":true,\"required\":false,\"show_in_table\":false,\"label_table\":\"\",\"show_in_export\":false,\"label_export\":\"\",\"layout_alignment\":\"right\",\"id\":1667745819998},{\"type\":\"answer_text_editor\",\"label\":\"Compilabile\",\"icon\":\"<i class=\'fa fa-edit\'><\\/i>\",\"question\":\"\",\"tooltip\":\"\",\"answer\":\"<p>&nbsp;ATTESO che nell&rsquo;ambito delle procedure di accoglienza dei migranti sbarcati sulle coste italiane &egrave; stato trasferito in questa provincia il\\/la cittadino\\/a {{ospite_cognome}} {{ospite_nome}}, nato il {{ospite_data_nascita}} in {{ospite_luogo_nascita}}, {{ospite_vestanet}}, {{ospite_cui}} <span style=\\\"background-color: #f1c40f;\\\">unitamente ai componenti del nucleo famigliare che seguono XXXXXX<\\/span><\\/p>\\n<div>&nbsp;CONSIDERATO che il <span style=\\\"background-color: #f1c40f;\\\">predetto migrante\\/nucleo<\\/span> richiedente protezione internazionale &egrave; stato assegnato presso la struttura temporanea denominata {{ente_denominazione}} sita in {{struttura_indirizzo}}, ai sensi dell&rsquo;art. 11 del D.Lgs 142\\/2015;<\\/div>\\n<p>&nbsp;<\\/p>\",\"preview\":true,\"conditioned\":false,\"connected_to\":\"\",\"show_on\":\"\",\"visible\":true,\"required\":false,\"show_in_table\":false,\"label_table\":\"\",\"show_in_export\":false,\"label_export\":\"\",\"layout_alignment\":\"right\",\"id\":1670856495733},{\"type\":\"fixed_text\",\"label\":\"Testo fisso\",\"icon\":\"<i class=\'fa fa-align-left\'><\\/i>\",\"value\":\"<div>&nbsp; &nbsp; &nbsp;CONSIDERATO che il predetto migrante richiedente protezione internazionale &egrave; stato assegnato presso la struttura temporanea denominata {{ente_denominazione}} sita in {{ente_indirizzo}}, ai sensi dell&rsquo;art. 11 del D.Lgs 142\\/2015;<\\/div>\\n<div>&nbsp; &nbsp; &nbsp;CONSIDERATE le verifiche svolte quanto alla posizione reddituale dell&rsquo;interessato;<\\/div>\\n<div>&nbsp; &nbsp; &nbsp;RITENUTO che si siano verificate le condizioni previste dal comma 1 lettera d dell&rsquo;art. 23 del D.Lgs 142\\/2015, che prevede, tra l&rsquo;altro, la revoca delle misure di accoglienza nel caso di: &ldquo;accertamento della disponibilita\' da parte del richiedente di mezzi economici sufficienti&rdquo;;<\\/div>\\n<div>&nbsp; &nbsp; &nbsp;VISTO il decreto legislativo n. 25 del 2008;<\\/div>\\n<div>&nbsp; &nbsp; &nbsp;VISTO il decreto legislativo n.142 del 2015;<\\/div>\\n<div>&nbsp; &nbsp; &nbsp;VISTA la circolare del Ministero dell&rsquo;Interno, Dipartimento per le Libert&agrave; Civili e&nbsp;&nbsp;<\\/div>\\n<div>l&rsquo;Immigrazione n. 2255 del 30.10.2015<\\/div>\\n<div>&nbsp; &nbsp; &nbsp;CONSIDERATO che il presente provvedimento costituisce atto dovuto e non discrezionale per l&rsquo;adozione del quale si omette la comunicazione prevista dagli artt. 7 e 8 della Legge 241\\/90;<\\/div>\\n<div>&nbsp;<\\/div>\\n<div style=\\\"text-align: center;\\\">DISPONE<\\/div>\\n<div>&nbsp;<\\/div>\",\"preview\":true,\"conditioned\":false,\"connected_to\":\"\",\"show_on\":\"\",\"visible\":true,\"show_in_table\":false,\"label_table\":\"\",\"show_in_export\":false,\"label_export\":\"\",\"layout_alignment\":\"right\",\"id\":1667745851661},{\"type\":\"answer_text_editor\",\"label\":\"Compilabile\",\"icon\":\"<i class=\'fa fa-edit\'><\\/i>\",\"question\":\"\",\"tooltip\":\"\",\"answer\":\"<p class=\\\"MsoFooter\\\" style=\\\"text-indent: 0cm;\\\"><span style=\\\"font-size: 11.0pt;\\\">Per i motivi indicati in premessa, la revoca della misura di accoglienza nei confronti di&nbsp;<\\/span>{{ospite_cognome}} {{ospite_nome}}, nato il {{ospite_data_nascita}} in {{ospite_luogo_nascita}<span style=\\\"font-size: 11.0pt;\\\">; <\\/span>{{ospite_vestanet}}, {{ospite_cui}} <span style=\\\"background-color: #f1c40f;\\\">e del nucleo famigliare<\\/span><\\/p>\\n<p class=\\\"MsoFooter\\\" style=\\\"text-indent: 0cm;\\\"><span style=\\\"font-size: 11.0pt;\\\">Il presente provvedimento di revoca ha effetto dal momento della sua comunicazione all&rsquo;interessato\\/i, ai sensi dell&rsquo;art. 23, comma 5 del D.Lgs 18.08.2015, n. 142, ovvero dall&rsquo;assolvimento delle procedure di notifica presso il luogo di domicilio ex art. 5, commi 1 e 2 del D.Lgs 142.<\\/span><\\/p>\\n<p class=\\\"MsoFooter\\\" style=\\\"text-indent: 0cm;\\\"><span style=\\\"font-size: 11.0pt;\\\">Il presente provvedimento &egrave; comunicato altres&igrave; al gestore della struttura di accoglienza, il quale, in caso di ricomparsa dell&rsquo;interessato, provveder&agrave; a consegnargliene copia.<\\/span><\\/p>\\n<p class=\\\"MsoFooter\\\" style=\\\"text-indent: 0cm;\\\"><span style=\\\"font-size: 11.0pt;\\\">Il presente provvedimento sar&agrave; trasmesso alle Prefetture e alle Questure presenti sul territorio nazionale e alla competente Commissione Territoriale per il riconoscimento della protezione internazionale.<\\/span><\\/p>\\n<p class=\\\"MsoFooter\\\" style=\\\"text-indent: 0cm;\\\"><span style=\\\"font-size: 11.0pt;\\\">Avverso il presente provvedimento &egrave; ammesso ricorso al Tribunale Amministrativo Regionale di Torino, nel termine di sessanta giorni dalla notifica all&rsquo;interessato.<\\/span><\\/p>\\n<p>&nbsp;<\\/p>\",\"preview\":true,\"conditioned\":false,\"connected_to\":\"\",\"show_on\":\"\",\"visible\":true,\"required\":false,\"show_in_table\":false,\"label_table\":\"\",\"show_in_export\":false,\"label_export\":\"\",\"layout_alignment\":\"right\",\"id\":1670856598848},{\"type\":\"answer_text_editor\",\"label\":\"Compilabile\",\"icon\":\"<i class=\'fa fa-edit\'><\\/i>\",\"question\":\"\",\"tooltip\":\"\",\"answer\":\"<p>&nbsp;<\\/p>\\n<table style=\\\"border-collapse: collapse; width: 100%; border-style: none;\\\" border=\\\"0\\\" cellpadding=\\\"4\\\">\\n<tbody>\\n<tr>\\n<td style=\\\"width: 50%;\\\">Torino, <span style=\\\"background-color: #f1c40f;\\\">DATA provvedimento<\\/span><\\/td>\\n<td style=\\\"width: 50%; text-align: right;\\\">\\n<p>p. il PREFETTO<\\/p>\\n<p><span style=\\\"background-color: #f1c40f;\\\">(nome dirigente area IV)<\\/span><\\/p>\\n<\\/td>\\n<\\/tr>\\n<\\/tbody>\\n<\\/table>\\n<p>&nbsp;<\\/p>\",\"preview\":true,\"conditioned\":false,\"connected_to\":\"\",\"show_on\":\"\",\"visible\":true,\"required\":false,\"show_in_table\":false,\"label_table\":\"\",\"show_in_export\":false,\"label_export\":\"\",\"layout_alignment\":\"right\",\"id\":1667746031727},{\"type\":\"fixed_text\",\"label\":\"Testo fisso\",\"icon\":\"<i class=\'fa fa-align-left\'><\\/i>\",\"value\":\"<div class=\\\"MsoFooter\\\" style=\\\"text-indent: 0cm;\\\"><span style=\\\"font-size: 9.0pt;\\\">Alla Questura di Torino per la traduzione, la notifica e gli adempimenti di competenza<\\/span><\\/div>\\n<div class=\\\"MsoFooter\\\" style=\\\"text-indent: 0cm;\\\"><span style=\\\"font-size: 9.0pt;\\\">Alla Struttura di Accoglienza {{ente_denominazione}}<\\/span><\\/div>\\n<div class=\\\"MsoFooter\\\" style=\\\"text-indent: 0cm;\\\"><span style=\\\"font-size: 9.0pt;\\\">Alla Commissione Territoriale per il riconoscimento della protezione internazionale<\\/span><\\/div>\\n<div class=\\\"MsoFooter\\\" style=\\\"text-indent: 0cm;\\\"><span style=\\\"font-size: 9.0pt;\\\">Alle Prefetture e alle Questure della Repubblica<\\/span><\\/div>\\n<div class=\\\"MsoFooter\\\" style=\\\"text-indent: 0cm;\\\"><span style=\\\"font-size: 9.0pt;\\\">All\'Anagrafe del Comune di {{struttura_comune}}<br \\/><\\/span><\\/div>\",\"preview\":true,\"conditioned\":false,\"connected_to\":\"\",\"show_on\":\"\",\"visible\":true,\"show_in_table\":false,\"label_table\":\"\",\"show_in_export\":false,\"label_export\":\"\",\"layout_alignment\":\"right\",\"id\":1667746093402}]}', '#890e7a', '63b566a187f885.94036302', 1, '2023-01-04 11:55:23', '2023-01-04 11:55:23');
