(964, 18, 1, '{\"open\":true,\"primary\":true,\"layout\":\"single\",\"visibility\":{\"visibility_by_component\":false,\"components\":[]},\"title\":\"\",\"subtitle\":\"\",\"color\":\"#bbb085\",\"items\":[],\"questions\":[{\"type\":\"image\",\"label\":\"Immagine\",\"icon\":\"<i class=\'fa fa-picture-o\'><\\/i>\",\"path\":\"2022\\/12\\/6397345e03ff9_logo_prefettura.png\",\"caption\":\"\",\"preview\":true,\"conditioned\":false,\"connected_to\":\"\",\"show_on\":\"\",\"visible\":true,\"show_in_table\":false,\"label_table\":\"\",\"show_in_export\":false,\"label_export\":\"\",\"layout_alignment\":\"left\",\"id\":1670853713871},{\"type\":\"answer_text_editor\",\"label\":\"Compilabile\",\"icon\":\"<i class=\'fa fa-edit\'><\\/i>\",\"question\":\"\",\"tooltip\":\"\",\"answer\":\"<p>&nbsp;<\\/p>\\n<table style=\\\"border-collapse: collapse; width: 100%; border-style: none;\\\" border=\\\"0\\\" cellpadding=\\\"4\\\">\\n<tbody>\\n<tr>\\n<td style=\\\"width: 50%;\\\">Prot. N <span style=\\\"background-color: #f1c40f;\\\">XXXX<\\/span>\\/<span style=\\\"background-color: #f1c40f;\\\">XXX<\\/span>\\/Area IV<\\/td>\\n<td style=\\\"width: 50%; text-align: right;\\\">Torino, <span style=\\\"background-color: #f1c40f;\\\">DATA PROT<\\/span><\\/td>\\n<\\/tr>\\n<\\/tbody>\\n<\\/table>\\n<p>&nbsp;<\\/p>\",\"preview\":true,\"conditioned\":false,\"connected_to\":\"\",\"show_on\":\"\",\"visible\":true,\"required\":false,\"show_in_table\":false,\"label_table\":\"\",\"show_in_export\":false,\"label_export\":\"\",\"layout_alignment\":\"right\",\"id\":1670748659020},{\"type\":\"answer_text_editor\",\"label\":\"Compilabile\",\"icon\":\"<i class=\'fa fa-edit\'><\\/i>\",\"question\":\"\",\"tooltip\":\"\",\"answer\":\"<table style=\\\"border-collapse: collapse; width: 100%; border-style: none; word-wrap: break-word;\\\" border=\\\"0\\\" cellpadding=\\\"4\\\">\\n<tbody>\\n<tr>\\n<td style=\\\"width: 40%;\\\">&nbsp;<\\/td>\\n<td style=\\\"width: 10%;\\\">&nbsp;<\\/td>\\n<td style=\\\"width: 50%; text-al