e=\\\"List Table 7 Colorful Accent 6\\\"\\/>\\n <\\/w:LatentStyles>\\n<\\/xml><![endif]--><!-- [if gte mso 10]>\\n<style>\\n \\/* Style Definitions *\\/\\n table.MsoNormalTable\\n\\t{mso-style-name:\\\"Tabella normale\\\";\\n\\tmso-tstyle-rowband-size:0;\\n\\tmso-tstyle-colband-size:0;\\n\\tmso-style-noshow:yes;\\n\\tmso-style-priority:99;\\n\\tmso-style-parent:\\\"\\\";\\n\\tmso-padding-alt:0cm 5.4pt 0cm 5.4pt;\\n\\tmso-para-margin-top:0cm;\\n\\tmso-para-margin-right:0cm;\\n\\tmso-para-margin-bottom:10.0pt;\\n\\tmso-para-margin-left:0cm;\\n\\tline-height:115%;\\n\\tmso-pagination:widow-orphan;\\n\\tfont-size:11.0pt;\\n\\tfont-family:\\\"Calibri\\\",sans-serif;\\n\\tmso-ascii-font-family:Calibri;\\n\\tmso-ascii-theme-font:minor-latin;\\n\\tmso-hansi-font-family:Calibri;\\n\\tmso-hansi-theme-font:minor-latin;\\n\\tmso-bidi-font-family:Arial;\\n\\tmso-bidi-theme-font:minor-bidi;}\\n<\\/style>\\n<![endif]--><\\/p>\\n<p class=\\\"MsoFooter\\\" style=\\\"text-indent: 0cm;\\\"><span style=\\\"font-size: 11.0pt;\\\">Per i motivi indicati in premessa, la revoca della misura di accoglienza nei confronti di&nbsp;<\\/span>{{ospite_cognome}} {{ospite_nome}}, nato il {{ospite_data_nascita}} in {{ospite_luogo_nascita}<span style=\\\"font-size: 11.0pt;\\\">;&nbsp; Vestanet<\\/span>{{ospite_vestanet}}, CUI {{ospite_cui}} <span style=\\\"background-color: #f1c40f;\\\">e del nucleo famigliare<\\/span><\\/p>\\n<p class=\\\"MsoFooter\\\" style=\\\"text-indent: 0cm;\\\"><span style=\\\"font-size: 11.0pt;\\\">Il presente provvedimento di revoca ha effetto dal momento della sua comunicazione all&rsquo;interessato\\/i, ai sensi dell&rsquo;art. 23, comma 5 del D.Lgs 18.08.2015, n. 142, ovvero dall&rsquo;assolvimento delle procedure di notifica presso il luogo di domicilio ex art. 5, commi 1 e 2 del D.Lgs 142.<\\/span><\\/p>\\n<p class=\\\"MsoFooter\\\" style=\\\"text-indent: 0cm;\\\"><span style=\\\"font-size: 11.0pt;\\\">Il presente provvedimento &egrave; comunicato altres&igrave; al gestore della struttura di accoglienza, il quale, in caso di ricomparsa dell&rsquo;interessato, provveder&agrave; a consegnargliene copia.<\\/span><\\/p>\\n<p class=\\\"MsoFooter\\\" style=\\\"text-indent: 0cm;\\\"><span style=\\\"font-size: 11.0pt;\\\">Il presente provvedimento sar&agrave; trasmesso alle Prefetture e alle Questure presenti sul territorio nazionale e alla competente Commissione Territoriale per il riconoscimento della protezione internazionale.<\\/span><\\/p>\\n<p class=\\\"MsoFooter\\\" style=\\\"text-indent: 0cm;\\\"><span style=\\\"font-size: 11.0pt;\\\">Avverso il presente provvedimento &egrave; ammesso ricorso al Tribunale Amministrativo Regionale di Torino, nel termine di sessanta giorni dalla notifica all&rsquo;interessato.<\\/span><\\/p>\",\"preview\":true,\"conditioned\":false,\"connected_to\":\"\",\"show_on\":\"\",\"visible\":true,\"required\":false,\"show_in_table\":false,\"label_table\":\"\",\"show_in_export\":false,\"label_export\":\"\",\"layout_alignment\":\"right\",\"id\":1670855574807},{\"type\":\"answer_text_editor\",\"label\":\"Compilabile\",\"icon\":\"<i class=\'fa fa-edit\'><\\/i>\",\"question\":\"\",\"tooltip\":\"\",\"answer\":\"<p>&nbsp;<\\/p>\\n<table style=\\\"border-collapse: collapse; width: 100%; border-style: none;\\\" border=\\\"0\\\" cellpadding=\\\"4\\\">\\n<tbody>\\n<tr>\\n<td style=\\\"width: 50%;\\\">Torino, <span style=\\\"background-color: #f1c40f;\\\">DATA provvedimento<\\/span><\\/td>\\n<td style=\\\"width: 50%; text-align: right;\\\">\\n<div>p. il PREFETTO<\\/div>\\n<div><span style=\\\"background-color: #f1c40f;\\\">(nome dirigente area IV)<\\/span><\\/div>\\n<\\/td>\\n<\\/tr>\\n<\\/tbody>\\n<\\/table>\\n<p>&nbsp;<\\/p>\",\"preview\":true,\"conditioned\":false,\"connected_to\":\"\",\"show_on\":\"\",\"visible\":true,\"required\":false,\"show_in_table\":false,\"label_table\":\"\",\"show_in_export\":false,\"label_export\":\"\",\"layout_alignment\":\"right\",\"id\":1670855760949},{\"type\":\"answer_text_editor\",\"label\":\"Compilabile\",\"icon\":\"<i class=\'fa fa-edit\'><\\/i>\",\"question\":\"\",\"tooltip\":\"\",\"answer\":\"<div><span style=\\\"font-size: 10pt;\\\">Alla Questura di Torino per la traduzione, la notifica e gli adempimenti di competenza<\\/span><\\/div>\\n<div><span style=\\\"font-size: 10pt;\\\">Alla Struttura di Accoglienza {{ente_denominazione}}<\\/span><\\/div>\\n<div><span style=\\\"font-size: 10pt;\\\">Alla Commissione Territoriale per il riconoscimento della protezione internazionale<\\/span><\\/div>\\n<div><span style=\\\"font-size: 10pt;\\\">Alle Prefetture e alle Questure della Repubblica<\\/span><\\/div>\\n<div><span style=\\\"font-size: 10pt;\\\">All&rsquo;Anagrafe del Comune di {{struttura_comune}}<\\/span><\\/div>\",\"preview\":true,\"conditioned\":false,\"connected_to\":\"\",\"show_on\":\"\",\"visible\":true,\"required\":false,\"show_in_table\":false,\"label_table\":\"\",\"show_in_export\":false,\"label_export\":\"\",\"layout_alignment\":\"right\",\"id\":1672829789892}]}', '#193e1c', '', 0, '2023-01-04 12:42:38', '2023-01-04 12:42:38');
